import React from 'react';
import C from './../styles/Profile.module.css'
const Profile = () => {
    return (
        <article className={C.article}>
            <div><img src="https://storge.pic2.me/cm/2560x1440/951/58487259adcd0.jpg" alt="" className={C.background} />
            </div>
            <div><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/Cat03.jpg/200px-Cat03.jpg" alt="" className={C.ava} /> desc</div>
            <div>my posts
          <div>new post</div>
                <div className={C.posts}>
                    <div className={`${C.item} ${C.active}`}>post1</div>
                    <div className={C.item}>post2</div>
                </div>
            </div>
        </article>
    )
}

export default Profile;
